import * as React from 'react';
import { AppBar, Toolbar, Typography, Menu, MenuItem, styled } from '@mui/material';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';
import Professionals from '../../views/profetionals/Professionals';
import Services from '../../views/Services/Services';
import Customers from '../../views/Customers/Customers';

// Importa tus componentes de clientes, profesionales y servicios


const StyledMenuItem = styled(MenuItem)({
  padding: '8px 16px',
  '&:hover': {
    backgroundColor: '#d3d3d3',
  },
});

const MenuContainer = styled('div')({
  display: 'flex',
  justifyContent: 'center',
  gap: '20px', // Espacio entre elementos
});

const CenteredToolbar = styled(Toolbar)({
  display: 'flex',
  justifyContent: 'center',
  marginLeft: '240px', // Ajusta el margen izquierdo aquí
  marginTop: '50px'
});

const DashboardNavBar = () => {
  const [section, setSection] = React.useState('clientes');

  return (
    <AppBar position="fixed" color="primary">
      <CenteredToolbar>
        <MenuContainer>
          <PopupState variant="popover" popupId="clientes-popup-menu">
            {(popupState) => (
              <React.Fragment>
                <Typography
                  variant="h6"
                  color={section === 'clientes' ? 'primary' : 'inherit'}
                  noWrap
                  onClick={() => setSection('clientes')}
                  {...bindTrigger(popupState)}
                >
                  Clientes
                </Typography>
                <Menu {...bindMenu(popupState)}>
                  <StyledMenuItem onClick={popupState.close}>Agregar Cliente</StyledMenuItem>
                </Menu>
              </React.Fragment>
            )}
          </PopupState>

          <PopupState variant="popover" popupId="profesionales-popup-menu">
            {(popupState) => (
              <React.Fragment>
                <Typography
                  variant="h6"
                  color={section === 'profesionales' ? 'primary' : 'inherit'}
                  noWrap
                  onClick={() => setSection('profesionales')}
                  {...bindTrigger(popupState)}
                >
                  Profesionales
                </Typography>
                <Menu {...bindMenu(popupState)}>
                  <StyledMenuItem onClick={popupState.close}>Agregar Profesional</StyledMenuItem>
                </Menu>
              </React.Fragment>
            )}
          </PopupState>

          <PopupState variant="popover" popupId="servicios-popup-menu">
            {(popupState) => (
              <React.Fragment>
                <Typography
                  variant="h6"
                  color={section === 'servicios' ? 'primary' : 'inherit'}
                  noWrap
                  onClick={() => setSection('servicios')}
                  {...bindTrigger(popupState)}
                >
                  Servicios
                </Typography>
                <Menu {...bindMenu(popupState)}>
                  <StyledMenuItem onClick={popupState.close}>Agregar Servicio</StyledMenuItem>
                </Menu>
              </React.Fragment>
            )}
          </PopupState>
        </MenuContainer>
      </CenteredToolbar>

      {/* Renderiza la sección correspondiente según el estado */}
      {section === 'clientes' && <Customers />}
      {section === 'profesionales' && <Professionals />}
      {section === 'servicios' && <Services />}
    </AppBar>
  );
};

export default DashboardNavBar;
